import React, {Component, Fragment} from 'react';
import './type.css';
import store from './store';
class Types extends Component{
    constructor(props){
        super(props);
        this.state = store.getState();
    }
    render(){
        console.log(this.state[this.props.type_name])
        return(
            <Fragment>
                <div id="produces_type">
                    {this.state[this.props.type_name].map((value)=>{
                        return (
                            <div key={value._uid} id="produces">
                                <img src={value.image} id="imgs"/>
                                <div id="simple_info">
                                    <span id="produces_name">{value.ig_handle}</span>
                                    <span id="produces_date">{value.date}</span>
                                </div>
                            </div>
                        )
                    })}
                </div>
            </Fragment>
        )
    }
}
export default Types;
